// Return Type  : void
//
static void getAllPeaks(const emxArray_real_T *y, emxArray_real_T *iPk,
  emxArray_real_T *iInf, emxArray_real_T *iInflect)
{
  emxArray_boolean_T *x;
  int i0;
  int ii;
  emxArray_int32_T *b_ii;
  int nx;
  int idx;
  boolean_T exitg1;
  boolean_T guard1 = false;
  emxArray_real_T *yTemp;
  emxInit_boolean_T(&x, 1);
  i0 = x->size[0];
  x->size[0] = y->size[0];
  emxEnsureCapacity((emxArray__common *)x, i0, (int)sizeof(boolean_T));
  ii = y->size[0];
  for (i0 = 0; i0 < ii; i0++) {
    x->data[i0] = rtIsInf(y->data[i0]);
  }

  i0 = x->size[0];
  emxEnsureCapacity((emxArray__common *)x, i0, (int)sizeof(boolean_T));
  ii = x->size[0];
  for (i0 = 0; i0 < ii; i0++) {
    x->data[i0] = (x->data[i0] && (y->data[i0] > 0.0));
  }

  emxInit_int32_T1(&b_ii, 1);
  nx = x->size[0];
  idx = 0;
  i0 = b_ii->size[0];
  b_ii->size[0] = x->size[0];
  emxEnsureCapacity((emxArray__common *)b_ii, i0, (int)sizeof(int));
  ii = 1;
  exitg1 = false;
  while ((!exitg1) && (ii <= nx)) {
    guard1 = false;
    if (x->data[ii - 1]) {
      idx++;
      b_ii->data[idx - 1] = ii;
      if (idx >= nx) {
        exitg1 = true;
      } else {
        guard1 = true;
      }
    } else {
      guard1 = true;
    }

    if (guard1) {
      ii++;
    }
  }

  if (x->size[0] == 1) {
    if (idx == 0) {
      i0 = b_ii->size[0];
      b_ii->size[0] = 0;
      emxEnsureCapacity((emxArray__common *)b_ii, i0, (int)sizeof(int));
    }
  } else {
    i0 = b_ii->size[0];
    if (1 > idx) {
      b_ii->size[0] = 0;
    } else {
      b_ii->size[0] = idx;
    }

    emxEnsureCapacity((emxArray__common *)b_ii, i0, (int)sizeof(int));
  }

  emxFree_boolean_T(&x);
  i0 = iInf->size[0];
  iInf->size[0] = b_ii->size[0];
  emxEnsureCapacity((emxArray__common *)iInf, i0, (int)sizeof(double));
  ii = b_ii->size[0];
  for (i0 = 0; i0 < ii; i0++) {
    iInf->data[i0] = b_ii->data[i0];
  }

  emxInit_real_T1(&yTemp, 1);
  i0 = yTemp->size[0];
  yTemp->size[0] = y->size[0];
  emxEnsureCapacity((emxArray__common *)yTemp, i0, (int)sizeof(double));
  ii = y->size[0];
  for (i0 = 0; i0 < ii; i0++) {
    yTemp->data[i0] = y->data[i0];
  }

  i0 = b_ii->size[0];
  b_ii->size[0] = iInf->size[0];
  emxEnsureCapacity((emxArray__common *)b_ii, i0, (int)sizeof(int));
  ii = iInf->size[0];
  for (i0 = 0; i0 < ii; i0++) {
    b_ii->data[i0] = (int)iInf->data[i0];
  }

  ii = b_ii->size[0];
  for (i0 = 0; i0 < ii; i0++) {
    yTemp->data[b_ii->data[i0] - 1] = rtNaN;
  }

  emxFree_int32_T(&b_ii);
  findLocalMaxima(yTemp, iPk, iInflect);
  emxFree_real_T(&yTemp);
}

